sealed class ConnectedFfiException: kotlin.Exception() {
    
    class InitializationException(
        
        val `msg`: kotlin.String
        ) : ConnectedFfiException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class DiscoveryException(
        
        val `msg`: kotlin.String
        ) : ConnectedFfiException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class ConnectionException(
        
        val `msg`: kotlin.String
        ) : ConnectedFfiException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class NotInitialized(
        ) : ConnectedFfiException() {
        override val message
            get() = ""
    }
    
    class InvalidArgument(
        
        val `msg`: kotlin.String
        ) : ConnectedFfiException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<ConnectedFfiException> {
        override fun lift(error_buf: RustBuffer.ByValue): ConnectedFfiException = FfiConverterTypeConnectedFfiError.lift(error_buf)
    }

    
}

/**
 * @suppress
 */
public object FfiConverterTypeConnectedFfiError : FfiConverterRustBuffer<ConnectedFfiException> {
    override fun read(buf: ByteBuffer): ConnectedFfiException {
        

        return when(buf.getInt()) {
            1 -> ConnectedFfiException.InitializationException(
                FfiConverterString.read(buf),
                )
            2 -> ConnectedFfiException.DiscoveryException(
                FfiConverterString.read(buf),
                )
            3 -> ConnectedFfiException.ConnectionException(
                FfiConverterString.read(buf),
                )
            4 -> ConnectedFfiException.NotInitialized()
            5 -> ConnectedFfiException.InvalidArgument(
                FfiConverterString.read(buf),
                )
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: ConnectedFfiException): ULong {
        return when(value) {
            is ConnectedFfiException.InitializationException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is ConnectedFfiException.DiscoveryException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is ConnectedFfiException.ConnectionException -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is ConnectedFfiException.NotInitialized -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
            )
            is ConnectedFfiException.InvalidArgument -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
        }
    }

    override fun write(value: ConnectedFfiException, buf: ByteBuffer) {
        when(value) {
            is ConnectedFfiException.InitializationException -> {
                buf.putInt(1)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is ConnectedFfiException.DiscoveryException -> {
                buf.putInt(2)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is ConnectedFfiException.ConnectionException -> {
                buf.putInt(3)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is ConnectedFfiException.NotInitialized -> {
                buf.putInt(4)
                Unit
            }
            is ConnectedFfiException.InvalidArgument -> {
                buf.putInt(5)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }

}




